import React from 'react'
import './ContentSidebar.css'
import HomeIcon from "@mui/icons-material/Home";
import SubscriptionsIcon from "@mui/icons-material/Subscriptions";
import VideoLibraryIcon from "@mui/icons-material/VideoLibrary";
import HistoryIcon from "@mui/icons-material/History";
import WhatshotIcon from "@mui/icons-material/Whatshot";
import MusicNoteIcon from "@mui/icons-material/MusicNote";
import MovieCreationIcon from "@mui/icons-material/MovieCreation";
import LiveTvIcon from "@mui/icons-material/LiveTv";
import SportsEsportsIcon from "@mui/icons-material/SportsEsports";
import NewspaperIcon from "@mui/icons-material/Newspaper";
import EmojiEventsIcon from "@mui/icons-material/EmojiEvents";
import TipsAndUpdatesIcon from "@mui/icons-material/TipsAndUpdates";
import BrushIcon from "@mui/icons-material/Brush";
import AddCircleOutlineIcon from "@mui/icons-material/AddCircleOutline";
export default function ContentSidebar() {
  return (
    <div id='ContentSidebar'>
      <HomeIcon id="ContentSidebarIcon"/><br/>
      <SubscriptionsIcon id="ContentSidebarIcon"/><br/>
      <VideoLibraryIcon id="ContentSidebarIcon"/><br/>
      <HistoryIcon id="ContentSidebarIcon"/><br/>
      <WhatshotIcon id="ContentSidebarIcon"/><br/>
      <MusicNoteIcon id="ContentSidebarIcon"/><br/>
      <MovieCreationIcon id="ContentSidebarIcon"/><br/>
      <LiveTvIcon id="ContentSidebarIcon"/><br/>
      <SportsEsportsIcon id="ContentSidebarIcon"/><br/>
      <NewspaperIcon id="ContentSidebarIcon"/><br/>
      <EmojiEventsIcon id="ContentSidebarIcon"/><br/>
      <TipsAndUpdatesIcon idContentSidebarIcon=""/><br/>
      <BrushIcon id="ContentSidebarIcon"/><br/>
      <AddCircleOutlineIcon id="ContentSidebarIcon"/><br/>
    </div>
  )
}
